import React from 'react';
import AuthMiddleware from './middleware/AuthMiddleware'

const Home = React.lazy(() => import('./views/backend/Home'));
const AdminIndex = React.lazy(() => import('./views/backend/admin/Index'));
const AdminCreate = React.lazy(() => import('./views/backend/admin/Create'));
const CityIndex = React.lazy(() => import('./views/backend/city/index'));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: '/admin', exact: true, name: 'Home',component:Home,middleware:AuthMiddleware},
  { path: '/admin/manager', exact: true, name: 'AdminIndex',component:AdminIndex,middleware:AuthMiddleware },
  { path: '/admin/city', exact: true, name: 'CityIndex',component:CityIndex,middleware:AuthMiddleware },
  { path: '/admin/manager/create', exact: true, name: 'AdminCreate',component:AdminCreate,middleware:AuthMiddleware }
];

export default routes;
